// import React from 'react';
import './App.css';
import React, { Component } from 'react';
import Card from './Components/Card.jsx';
import { isDeclareTypeAlias } from '@babel/types';

class About extends Component {



    render() {


        return (
            <div>
                <div className="section">
                    <h1>education</h1>
                    <h2>University of Waterloo</h2>
                    <ul>
                        <li>John and Karen Wetmore Scholarship</li>
                        <li>President's </li>
                    </ul>
                    <h2>Westmount Secondary</h2>
                </div>
                <div className="section-test">
                    <h1>awards</h1>
                    <ul>
                        <li>Senior Girls Basketball Championship</li>
                        <li>Senior Computer Science award</li>
                    </ul>
                </div>
                <div>
                    interests
                </div>
                <div>
                    <h1>contact</h1>
                    <ul>
                        <li>github</li>
                        <li>email: yeri.kim@uwaterloo.ca</li>
                        <li>linkedin</li>
                    </ul>
                </div>
            </div>

        );
    }
}

export default About;
